    "2013-03-14T19:28:34.726828",nt"name": "santa-barbara-littoral-cell-crsmp-offshore-sand-sources-20090e4cd",nt"isopen":
    false,nt"url": null,nt"notes": "Offshore sand sources exist at four known
    locations and potentially other yet to be explored regions within the nearshore
    coastal shelf. Significant reserves of fine sand have been identified offshore of
    Goleta County Beach, Santa Barbara East Beach, Carpinteria Beach, and the Santa
    Clara River delta. These deposits, totaling in the millions of cubic yards, constitute
    the most significant resource of sand that is available for beach renourishment
    and supplementation of littoral sediment budgets. Locations compiled by Noble Consultants
    for the Shoreline Survey. Submitted to CSMW by BEACON as part of the Central Coast
    (from Pt. Conception to Pt. Mugu) Coastal Regional Sediment Management Plan (2009).",nt"license_title":
